package com.olympus.penetration;

public class CsvData {
	private String month;
	private String year;
	private String extMatGrp;
	private double fisSales;
	private double eligSales;
	private double penPercent;
	private int position;
	

	/****************************************************************************************************************************************************/	
	public CsvData() {
		// TODO Auto-generated constructor stub
	}


	public int getPosition() {
		return position;
	}


	public void setPosition(int position) {
		this.position = position;
	}


	public String getMonth() {
		return month;
	}


	public void setMonth(String month) {
		this.month = month;
	}


	public String getYear() {
		return year;
	}


	public void setYear(String year) {
		this.year = year;
	}


	public String getExtMatGrp() {
		return extMatGrp;
	}


	public void setExtMatGrp(String extMatGrp) {
		this.extMatGrp = extMatGrp;
	}


	public double getFisSales() {
		return fisSales;
	}


	public void setFisSales(double fisSales) {
		this.fisSales = fisSales;
	}


	public double getEligSales() {
		return eligSales;
	}


	public void setEligSales(double eligSales) {
		this.eligSales = eligSales;
	}


	public double getPenPercent() {
		return penPercent;
	}


	public void setPenPercent(double penPercent) {
		this.penPercent = penPercent;
	}

	
	 

	/****************************************************************************************************************************************************/

	
	/****************************************************************************************************************************************************/

	
}
